import React from 'react';
import FadeIn from 'react-fade-in';
import amani_pic from '../media/amani.jpg';
import "../styles/home.css";

const Home = () => {
  return (
    <div id="home-div">
      <FadeIn></FadeIn><h1>About</h1>
      <FadeIn>
      <div id="intro-div">
        <div>
          <p>I am an incoming PhD student at <a>MIT Brain & Cognitive Sciences</a>, where I will research cognition by studying human and artificial intelligence in tandem. I am excited about using artificial intelligence as a scientific tool to study how the mind works, and using what we know about the mind to develop more cognitively-realistic models. My work will be supported by the <a>School of Science Dean's Fellowship</a>.</p>
          <p>I earned my Bachelor's with high distinction and departmental honors in Computer Science and Mathematics from <a>Harvey Mudd College</a>, where I worked with <a>George Monta&ntilde;ez</a> in the <a>AMISTAD lab</a>. My work was supported by the <a>Astronaut Scholarship</a> and earned the <a>CRA Outstanding Undergraduate Researcher Award</a>.</p>
        </div>
        <img id="amani-pic" src={amani_pic}/>
      </div>
      </FadeIn>
    </div>
  );
}

export default Home;
